 import  React  from "react"
 import  Calc from "../calctor/app"
 import  Userlist from "../userlist/Userlist"
 export   default  class List  extends  React.Component{

        constructor(props){
             super(props)
             this.state={
                display1:"none",
                display2:"none",
                blue:"blue"
             }
            this.index=this.index.bind(this) 
            this.user=this.user.bind(this)
         }
        render(){
            return   <div>
                        <div  id="lists">
                                <div></div>
                                {/* // eslint-disable-next-line */}
                                <div  id="index1" onClick={this.index}  className={this.state.display1==="block"?this.state.blue:""}>首页</div>
                                <div></div>
                                {/* // eslint-disable-next-line */}
                                <div  id="sale1" onClick={this.user}  className={this.state.display2==="block"?this.state.blue:""}>收入分析</div>
                                <div></div>
                        </div>
                        <Calc display={this.state.display1} />
                        <Userlist display={this.state.display2}/>
                     </div>

         }
        //  tab 按钮切换
        index(){
            this.setState({
                    display1:"block",
                    display2:"none"
            }) 
         }
        user(){
                this.setState({
                        display1:"none",
                        display2:"block"
                }) 
         }
}
